using System;
using System.Text;
using System.Runtime.InteropServices;

public class Program
{
    public static void Main()
    {
        new Program().Start();
    }

    string data = "";

    byte[] HexStringToBytes(string hex)
    {
        byte[] res = new byte[hex.Length / 2];
        for (int i = 0; i < res.Length; i++)
        {
            string hexLiteral = hex.Substring(i * 2, 2);
            byte val = byte.Parse(hexLiteral, System.Globalization.NumberStyles.HexNumber);
            res[i] = val;
        }
        return res;
    }

    [DllImport("msys-lz4-1.dll")]
    static extern int LZ4_decompress_safe (byte[] src, byte[] dst, int compressedSize, int dstCapacity);

    public void Start()
    {
        byte[] bytes = HexStringToBytes(data);

        byte[] output = new byte[1319724];
        LZ4_decompress_safe(bytes, output, bytes.Length, 1319724);

        File.WriteAllBytes("test.bin", output);

        Console.WriteLine("Done");
    }
}
